import React from 'react'

const style = {
    border: 'solid red 1px',
    color: 'blue'
  }
  

const NavBar = () => {
  return (
      <div>
        <li style={style}>Home</li>
        <li>Laptops</li>
        <li>Tablets</li>
        <li>Smartphones</li>
      </div>
      )
}

export default NavBar
